import React from "react";

const Fact = (props) => {
  return (
      <article>
      <h1>
        {props.numberToDisplay + ' '}
        {props.topicToDisplay + ' '} fact</h1>
      <div className='measure-wide'>
      <p >{props.factToDisplay}</p>
    </div>
    </article>
  );
}
export default Fact;
